CREATE TABLE V022 (
  IDMPAC varchar(255) DEFAULT NULL,
  MPACNAME varchar(255) DEFAULT NULL,
  DATEBEG varchar(255) DEFAULT NULL,
  DATEEND varchar(255) DEFAULT NULL
)
ENGINE = INNODB,
AVG_ROW_LENGTH = 317,
CHARACTER SET utf8,
COLLATE utf8_general_ci;


CREATE TABLE V019 (
  IDHM varchar(255) DEFAULT NULL,
  HMNAME varchar(255) DEFAULT NULL,
  DIAG varchar(255) DEFAULT NULL,
  HVID varchar(255) DEFAULT NULL,
  HGR varchar(255) DEFAULT NULL,
  HMODP varchar(255) DEFAULT NULL,
  IDMODP varchar(255) DEFAULT NULL,
  DATEBEG varchar(255) DEFAULT NULL,
  DATEEND varchar(255) DEFAULT NULL
)
ENGINE = INNODB,
AVG_ROW_LENGTH = 458,
CHARACTER SET utf8,
COLLATE utf8_general_ci;


